import React from 'react';

const Projects = () => {
    return (
        <div className="projects">
            <h2>My Projects</h2>
            <ul>
                <li><a href="https://github" target="_blank" rel="noopener noreferrer">Project 1</a></li>
                <li><a href="https://github.com/your-repo-2" target="_blank" rel="noopener noreferrer">Project 2</a></li>
                <li><a href="https://github.com/your-repo-3" target="_blank" rel="noopener noreferrer">Project 3</a></li>
            </ul>
        </div>
    );
};

export default Projects;
